import React from 'react';
import "./Contact.css";

function Contact() {
    return (
        <div className="contact-container">
            <div className="contact-wrapper">
                <h1 className="contact-text">
                    Contact hi@builtbyjavi.com 
                </h1>
                <h1 className="contact-text">
                    for opportunities to
                </h1>
                <h1 className="contact-text">
                    COLLABORATE
                </h1>
            </div>
            
        </div>
    )
}

export default Contact
